% Objective function (Maximize Z = -3x + 2y)
C = [-3 2 0 0 -1e5 -1e5];   % Add Big M penalties (negative for maximization)

% Constraints (converted for simplex):
% x + y - s1 + a1 = 6
% 2x - y - s2 + a2 = 9

A = [1  1 -1  0 1 0; 
     2 -1  0 -1 0 1];
b = [6; 9];

[m, n] = size(A);

% Initial basic variables (artificial variables are basic initially)
bv_index = [5 6];

% Form initial tableau
Y = [A b];

% Initial values
xb = Y(:, end);
cb = C(bv_index);

% Compute initial Zj - Cj
zicj = cb * Y(:, 1:n) - C;
z = cb * xb;
table = [zicj z; Y];
disp('Initial Tableau:');
disp(table);

% Simplex loop
while any(zicj < 0)
    [~, ev] = min(zicj);  % Entering variable

    if all(Y(:, ev) <= 0)
        disp("Unbounded solution");
        return;
    end

    ratio = inf(m, 1);
    for j = 1:m
        if Y(j, ev) > 0
            ratio(j) = xb(j) / Y(j, ev);
        end
    end

    [~, lv] = min(ratio); % Leaving variable
    bv_index(lv) = ev;

    % Pivot operation
    pivot = Y(lv, ev);
    Y(lv, :) = Y(lv, :) / pivot;

    for i = 1:m
        if i ~= lv
            Y(i, :) = Y(i, :) - Y(i, ev) * Y(lv, :);
        end
    end

    % Update tableau
    xb = Y(:, end);
    cb = C(bv_index);
    zicj = cb * Y(:, 1:n) - C;
    z = cb * xb;

    table = [zicj z; Y];
    disp('Next Tableau:');
    disp(table);
end

% Final Result (no sign change needed for maximization)
fprintf('\nOptimal value (Max Z): %.2f\n', z);
for i = 1:n
