#include <iostream>

using namespace std;
class Korisnik {
private:
    char ime[20];
    float tezini[30];
    int br_merenja;
public:
    Korisnik() {
        strcpy(ime, "");
        br_merenja = 1;
        tezini[0] = 60;
    }
    Korisnik(char * _ime, float * _tezini, int _br_merenje) {
        br_merenja = _br_merenje;
        strcpy(ime, _ime);
        for(int i = 0; i < br_merenja; i++) {
            tezini[i] = _tezini[i];
        }
        
    }
    Korisnik(const Korisnik & tmp) {
        br_merenja = tmp.br_merenja;
        strcpy(ime, tmp.ime);
        for(int i = 0; i < br_merenja; i++) {
            tezini[i] = tmp.tezini[i];
        }
    }
    ~Korisnik() {}
    
    void pechati() {
        cout << ime << " " << br_merenja << endl;
        for(int i = 0; i < br_merenja; i++) {
            cout << tezini[i] << " " ;
        }
        cout << endl;
    }
    void dodadiMerenje(float m) {
        float tmp[br_merenja];
        for(int i = 0; i < br_merenja; i++) {
            tmp[i] = tezini[i];
        }
        tezini[0] = m;
        br_merenja++;
        for(int i = 1; i < br_merenja; i++) {
            tezini[i] = tmp[i - 1];
        }
    }
    void brishiMerenje() {
        float tmp[br_merenja];
        for(int i = 1; i < br_merenja; i++) {
            tmp[i - 1] = tezini[i];
        }
        br_merenja--;
        for(int i = 0; i < br_merenja; i++) {
            tezini[i] = tmp[i];
        }
    }
};

int main()
{
    float niza[4] = {10.5, 4.6, 9.4, 5.8};
    Korisnik k("Petar", niza, 4);
    k.pechati();
    k.dodadiMerenje(75.3);
    k.pechati();
    k.brishiMerenje();
    k.pechati();
    
    return 0;
}

