#include <iostream>

using namespace std;
class Recenica {
private:
    char * niza;
public:
    Recenica() {
        niza = new char[6];
        strcpy(niza, "Zdravo");
    }
    Recenica(char * _niza) {
        niza = new char[strlen(_niza)];
        strcpy(niza, _niza);
    }
    Recenica(const Recenica & tmp) {
        niza = new char[strlen(tmp.niza)];
        strcpy(niza, tmp.niza);
    }
    ~Recenica() {
        delete [] niza;
    }
    
    void pechati() {
        cout << niza << endl;
    }
    void dodadiZnaci(char * _niza, bool lok) {
        char * tmp = new char[strlen(niza) + strlen(_niza)];
        if(lok == 1) {
            strcpy(tmp, niza);
            strcat(tmp, _niza);
        }
        else {
            strcpy(tmp, _niza);
            strcat(tmp, niza);
        }
        niza = new char[strlen(tmp)];
        strcpy(niza, tmp);
    }
    void brishiZnak(int poz) {
        char * tmp = new char[strlen(niza) - 1];
        int idx = 0;
        for(int i = 0; i < strlen(niza); i++) {
            if(i != poz) {
                tmp[idx] = niza[i];
                idx++;
            }
        }
        niza = new char[strlen(niza) - 1];
        strcpy(niza, tmp);
    }
};

int main()
{
    char recenica[25] = "Mnogu sakam da ucham PSP";
    Recenica r(recenica);
    
    r.pechati();
    r.dodadiZnaci("za copy konstruktor", 1);
    r.brishiZnak(24);
    r.pechati();
    return 0;
}

