if ( ! defined( 'ABSPATH' ) ) exit;

function finance_app_enqueue_assets() {
    if (! is_singular()) return;

    global $post;
    if (has_shortcode($post->post_content, 'finance_calculator')) {
        $plugin_url = plugin_dir_url( __FILE__ );

        wp_enqueue_style( 'finance_app_css', $plugin_url . 'main.css', array(), '1.0' );
        wp_enqueue_script( 'finance_app_js', $plugin_url . 'main.js', array('jquery'), '1.0', true );

        wp_add_inline_script( 'finance_app_js',
            'const FINANCE_APP_URL = "' . esc_url($plugin_url) . '";',
            'before'
        );
    }
}
add_action( 'wp_enqueue_scripts', 'finance_app_enqueue_assets' );

function finance_app_shortcode() {
    ob_start();
    include plugin_dir_path( __FILE__ ) . 'index.html';
    $content = ob_get_clean();

    $plugin_url = plugin_dir_url( __FILE__ );
    $content = str_replace('src="assets/', 'src="' . $plugin_url . 'assets/', $content);
    $content = str_replace('href="assets/', 'href="' . $plugin_url . 'assets/', $content);

    return '<div class="finance-calculator-container">' . $content . '</div>';
}
add_shortcode( 'finance_calculator', 'finance_app_shortcode' );

